window.bookSummaryJSON = "<p><b>I stole from the Twisted Kings, and now I'm at the mercy of Jameson Steel.</b></p> <p>It's not like I planned any of this... In the same way, I didn't plan on being the only parent to my four-year-old brother.</p> <p>But one night, everything went sideways, and now Jameson is my only chance at getting out of this mess.</p> <p>He doesn't trust me, but he needs me to get back at the man who sent me to his clubhouse. His protection for my cooperation. As long as my brother is safe, it's a deal I can't refuse.</p> <p>But living with the enemy is dangerous. Jameson's vengeance is prolific. He only cares about revenge, and he's not interested in the pre-built family I come with.</p> <p>The Twisted Kings are his life. Nothing comes before his club or the president patch on his chest—especially not us.</p> <p>Or so I thought…</p> <p>Steel <i>is a dark MC President and his traitor's daughter romance with a morally grey hero and heavy subject matter. Contains mature content. A complete list of content warnings can be found on the author's website.</i></p>"; 
